import React, { Component } from 'react';
import {Grid, Cell} from 'react-mdl';
class contact extends Component{
    render(){
        return(
         <div className="contact-body">
            <Grid className="contact-grid">
                <Cell col={6}>
                        <h2>Abhineet Pandey</h2>
                        <img 
                            src="https://lh3.googleusercontent.com/proxy/Wb-8wGYgcMmU0g0aPL685qVJ0sS22J7ZrpYEuUMkpIVdwbqkbGycw7AZc5yXgm9nGfvj1r3nzMg7jZaklx_och1FZmw4a88A11xzcKjjynnedMyQ9zOpM5K9ZcSc"
                            alt="avatar"
                            style={{height: '250px'}}
                        />
                        <Cell col={5}>
                        <p style={{widht: '50%', margin: 'auto', paddingTop: '2em'}}>Hey there! You may contact me if you have some interesting opportunity for me, or maybe to discuss books and politics?</p>
                        </Cell>
                </Cell>
                <Cell col={6}>half page</Cell>
            </Grid>
         </div>
        )
    }
}

export default contact;
